contracts/ejercicio5.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract exercise5 {
    string private storedInfo;
    uint public countChanges = 0;
    address private owner;
    constructor(){
        owner = msg.sender;
        storedInfo = "Hello Ethereum";
        countChanges++;
    }
 
    event infoChanged(string oldInfo, string newInfo, address account);

    function setInfo(string memory myInfo) external {
        require(owner == msg.sender, "Only owner can perform this action");
        emit infoChanged(storedInfo, myInfo, msg.sender);
        storedInfo = myInfo;
        countChanges++;
    }

    function getInfo() external view returns(string memory) {
        return storedInfo;
    }
}

